<h4 id="format_GS_results(model_name:-str,-model_object:-object,-metric:-str)---Function-to-get-scores-from-Gridsearch"><a id="toc2_3_4_3_"></a><a href="#toc0_">format_GS_results(model_name: str, model_object: object, metric: str) - Function to get scores from Gridsearch</a><a class="anchor-link" href="#format_GS_results(model_name:-str,-model_object:-object,-metric:-str)---Function-to-get-scores-from-Gridsearch">¶</a></h4>
