<div class="cm-editor cm-s-jupyter">
<div class="highlight hl-ipython3"><pre><span></span><span class="k">def</span> <span class="nf">format_GS_results</span><span class="p">(</span><span class="n">model_name</span><span class="p">:</span> <span class="nb">str</span><span class="p">,</span> <span class="n">model_object</span><span class="p">:</span> <span class="nb">object</span><span class="p">,</span> <span class="n">metric</span><span class="p">:</span> <span class="nb">str</span><span class="p">):</span>
<span class="w">    </span><span class="sd">'''</span>
<span class="sd">    Returns a pandas df with the F1, recall, precision, accuracy, and auc scores</span>
<span class="sd">    from the GridSearch.</span>
<span class="sd">    </span>
<span class="sd">    Arguments:</span>
<span class="sd">        model_name (string): what you want the model to be called in the output table</span>
<span class="sd">        model_object: a fit GridSearchCV object from test data</span>
<span class="sd">        metric (string): precision, recall, f1, accuracy, or auc</span>
<span class="sd">  </span>
<span class="sd">      </span>
<span class="sd">    '''</span>

    <span class="c1"># Create dictionary that maps input metric to actual metric name in GridSearchCV</span>
    <span class="n">metric_dict</span> <span class="o">=</span> <span class="p">{</span><span class="s1">'auc'</span><span class="p">:</span> <span class="s1">'mean_test_roc_auc'</span><span class="p">,</span>
                   <span class="s1">'precision'</span><span class="p">:</span> <span class="s1">'mean_test_precision'</span><span class="p">,</span>
                   <span class="s1">'recall'</span><span class="p">:</span> <span class="s1">'mean_test_recall'</span><span class="p">,</span>
                   <span class="s1">'f1'</span><span class="p">:</span> <span class="s1">'mean_test_f1'</span><span class="p">,</span>
                   <span class="s1">'accuracy'</span><span class="p">:</span> <span class="s1">'mean_test_accuracy'</span>
                  <span class="p">}</span>

    <span class="c1"># Get all the results from the CV and put them in a df</span>
    <span class="n">cv_results</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">DataFrame</span><span class="p">(</span><span class="n">model_object</span><span class="o">.</span><span class="n">cv_results_</span><span class="p">)</span>

    <span class="c1"># Isolate the row of the df with the max(metric) score</span>
    <span class="n">best_estimator_results</span> <span class="o">=</span> <span class="n">cv_results</span><span class="o">.</span><span class="n">iloc</span><span class="p">[</span><span class="n">cv_results</span><span class="p">[</span><span class="n">metric_dict</span><span class="p">[</span><span class="n">metric</span><span class="p">]]</span><span class="o">.</span><span class="n">idxmax</span><span class="p">(),</span> <span class="p">:]</span>

    <span class="c1"># Extract Accuracy, precision, recall, and f1 score from that row</span>
    <span class="n">auc</span> <span class="o">=</span> <span class="n">best_estimator_results</span><span class="o">.</span><span class="n">mean_test_roc_auc</span>
    <span class="n">f1</span> <span class="o">=</span> <span class="n">best_estimator_results</span><span class="o">.</span><span class="n">mean_test_f1</span>
    <span class="n">recall</span> <span class="o">=</span> <span class="n">best_estimator_results</span><span class="o">.</span><span class="n">mean_test_recall</span>
    <span class="n">precision</span> <span class="o">=</span> <span class="n">best_estimator_results</span><span class="o">.</span><span class="n">mean_test_precision</span>
    <span class="n">accuracy</span> <span class="o">=</span> <span class="n">best_estimator_results</span><span class="o">.</span><span class="n">mean_test_accuracy</span>
  
    <span class="c1"># Create table of results</span>
    <span class="n">table</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">DataFrame</span><span class="p">()</span>
    <span class="n">table</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">DataFrame</span><span class="p">({</span><span class="s1">'Model'</span><span class="p">:</span> <span class="p">[</span><span class="n">model_name</span><span class="p">],</span>
                          <span class="s1">'Precision'</span><span class="p">:</span> <span class="p">[</span><span class="n">precision</span><span class="p">],</span>
                          <span class="s1">'Recall'</span><span class="p">:</span> <span class="p">[</span><span class="n">recall</span><span class="p">],</span>
                          <span class="s1">'F1'</span><span class="p">:</span> <span class="p">[</span><span class="n">f1</span><span class="p">],</span>
                          <span class="s1">'Accuracy'</span><span class="p">:</span> <span class="p">[</span><span class="n">accuracy</span><span class="p">],</span>
                          <span class="s1">'AUC'</span><span class="p">:</span> <span class="p">[</span><span class="n">auc</span><span class="p">]</span>
                        <span class="p">})</span>
  
    <span class="k">return</span> <span class="n">table</span>
</pre></div>
