<h4 id="make_lr_results(model_name:-str,-model_object:-object,-X_var:-str,-y_var:-str,-y_pred_var:-str)"><a id="toc2_3_4_4_"></a><a href="#toc0_">make_lr_results(model_name: str, model_object: object, X_var: str, y_var: str, y_pred_var: str)</a><a class="anchor-link" href="#make_lr_results(model_name:-str,-model_object:-object,-X_var:-str,-y_var:-str,-y_pred_var:-str)">¶</a></h4>
