<h2 id="Construct-Model---Random-Forest---rf2---No-Departments"><a id="toc3_4_"></a><a href="#toc0_">Construct Model - Random Forest - <code>rf2</code> - No Departments</a><a class="anchor-link" href="#Construct-Model---Random-Forest---rf2---No-Departments">¶</a></h2>
</div>
</div>
</div>
</div>
<div class="jp-Cell jp-MarkdownCell jp-Notebook-cell">
<div class="jp-Cell-inputWrapper" tabindex="0">
<div class="jp-Collapser jp-InputCollapser jp-Cell-inputCollapser">
</div>
<div class="jp-InputArea jp-Cell-inputArea"><div class="jp-InputPrompt jp-InputArea-prompt">
</div><div class="jp-RenderedHTMLCommon jp-RenderedMarkdown jp-MarkdownOutput" data-mime-type="text/markdown">
<h3 id="Import-Data---rf2---No-Departments"><a id="toc3_4_1_"></a><a href="#toc0_">Import Data - <code>rf2</code> - No Departments</a><a class="anchor-link" href="#Import-Data---rf2---No-Departments">¶</a></h3><p>Two datasets for model performance comparison, :</p>
<ul>
<li><code>data_cleaned_NoOl_FE_AllFeat.csv</code>  is the full data set feature engineered with <code>salary</code> encoded to ordinal,  <code>avg_mth_hrs</code> binary encoded to <code>overwork</code> and dept encoded with dummies</li>
<li><code>data_cleaned_NoOl_FE_NoDept.csv</code> (THIS DATA) is the same data with the dummy encoded dept fields removed.</li>
</ul>
<p><code>Dept</code> appears to have low correlation across the dataset and I'm curious how much the models are influenced with low correlation features. It turns out that low correlation features have little impact on model performance. which is no surprise really!</p>
<h4 id="Code-flags:"><a id="toc3_4_1_1_"></a><a href="#toc0_">Code flags:</a><a class="anchor-link" href="#Code-flags:">¶</a></h4><p><strong>rerun</strong> = flag to identify the first run of the model comparisons and write a NEW Results.csv file. 0 = first run and a new file will be created with headers / 1 = Continuation, Results will be appended to the file.</p>
<p><strong>dataset</strong> = Text indicating which dataset is being used, added to the model description during csv save to Results.csv</p>
<p><strong>model_prefix</strong> = text indicating which ML model is being used, added to the model description during csv save to Results.csv</p>
<p><strong>refit</strong> = Random Forest fits with this data takes 20-30 mins.
1 = Fit Data and Pickle Save Model
0 = don't refit data, Pickle load model</p>
<p><strong>fitver</strong> = suffix added to pickle save model file name to help distinguish rf1/rf2 and all feature or focus features datasets</p>
</div>
</div>
</div>
</div><div class="jp-Cell jp-CodeCell jp-Notebook-cell">
