<span class="c1"># Feature engineering on salary, avg_mnth_hrs, outliers removed, departments removed</span>
<span class="n">df2</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">read_csv</span><span class="p">(</span><span class="n">load_path</span> <span class="o">+</span> <span class="s2">"data_cleaned_NoOl_FE_NoDept.csv"</span><span class="p">,</span> <span class="n">index_col</span> <span class="o">=</span> <span class="kc">False</span><span class="p">)</span> 

<span class="n">df2</span><span class="o">.</span><span class="n">sort_index</span><span class="p">(</span><span class="n">axis</span><span class="o">=</span><span class="mi">1</span><span class="p">,</span> <span class="n">inplace</span><span class="o">=</span><span class="kc">True</span><span class="p">)</span>

<span class="c1"># model_prefix : Str prefix for results.csv added to dataset</span>
<span class="n">model_prefix</span>   <span class="o">=</span> <span class="s1">'rf2'</span>   

<span class="c1"># dataset : Str = dataset save name for results.csv</span>
<span class="n">dataset</span>        <span class="o">=</span> <span class="s1">'NOdept'</span>

<span class="c1"># fitver : Str = Suffix for the pickle save filename</span>
<span class="n">fitver</span>         <span class="o">=</span> <span class="s1">'NOdept'</span>  

<span class="c1"># rerun : int =  Flag to set 1 = append to Results.csv / 0 = Overwrite with new file</span>
<span class="n">rerun</span>          <span class="o">=</span> <span class="mi">1</span>

<span class="c1"># refit : int - 1 = Fit Data and Save model / 0 = load model, don't fit data</span>
<span class="n">refit</span>          <span class="o">=</span> <span class="mi">0</span>         <span class="c1"># 1 = Fit Data and Save model / 0 = load model, don't fit data</span>

<span class="nb">print</span><span class="p">(</span><span class="s2">"df2 - FOCUS FEATURES - Feature engineering on salary, avg_mnth_hrs, dept REMOVED, outliers removed</span><span class="se">\n</span><span class="s2">"</span><span class="p">)</span>

