<h2 id="Conclusion,-model-comparison---RandomForest."><a id="toc4_6_"></a><a href="#toc0_">Conclusion, model comparison - RandomForest.</a><a class="anchor-link" href="#Conclusion,-model-comparison---RandomForest.">¶</a></h2><p>Again, there is almost no difference to the performance of the two datasets (<code>AllFeat</code>/<code>NoDept</code>) when modelled through any of the four models tested. While there's a tiny improvement in RandomForest vs DecisionTree, there's almost no difference in feature importance.</p>
<p>SHAP and Feature importance are showing similar results with the ranking of importance :</p>
<ul>
<li>Satisfaction</li>
<li>Number of Projects</li>
<li>Tenure</li>
<li>Last Eval Score</li>
<li>Overworked flag</li>
</ul>
<p>The department the employees works in has minimal bearing on these results.</p>
<p>The improvement we see in RandomForest is in predictions, where <strong>predicted to leave</strong> is at ~95% which is either overfitting or a super accurate model. I'll review the RandomForest model in the demonstration.</p>
</div>
