<div class="highlight hl-ipython3"><pre><span></span><span class="c1">#tree2_importances = pd.DataFrame(tree2.best_estimator_.feature_importances_, columns=X.columns)</span>
<span class="c1"># Get feature importances (Gini importance)</span>
<span class="n">feature_importance</span> <span class="o">=</span> <span class="n">rf2_best_model</span><span class="o">.</span><span class="n">feature_importances_</span>

<span class="c1"># Get the names of the features</span>
<span class="n">feature_names</span> <span class="o">=</span> <span class="n">X2</span><span class="o">.</span><span class="n">columns</span>  <span class="c1"># Replace with your feature names</span>

<span class="c1"># Create a DataFrame to store feature names and their Gini importance</span>
<span class="n">importance_df</span> <span class="o">=</span> <span class="n">pd</span><span class="o">.</span><span class="n">DataFrame</span><span class="p">({</span><span class="s1">'Feature'</span><span class="p">:</span> <span class="n">feature_names</span><span class="p">,</span> <span class="s1">'Feature Importance'</span><span class="p">:</span> <span class="n">feature_importance</span><span class="p">})</span>

<span class="c1"># Sort the DataFrame by Gini importance in descending order</span>
<span class="n">importance_df</span> <span class="o">=</span> <span class="n">importance_df</span><span class="o">.</span><span class="n">sort_values</span><span class="p">(</span><span class="n">by</span><span class="o">=</span><span class="s1">'Feature Importance'</span><span class="p">,</span> <span class="n">ascending</span><span class="o">=</span><span class="kc">True</span><span class="p">)</span>

<span class="c1"># Plot the Gini importance values</span>
<span class="n">plt</span><span class="o">.</span><span class="n">figure</span><span class="p">(</span><span class="n">figsize</span><span class="o">=</span><span class="p">(</span><span class="mi">10</span><span class="p">,</span> <span class="mi">6</span><span class="p">))</span>
<span class="n">plt</span><span class="o">.</span><span class="n">barh</span><span class="p">(</span><span class="n">importance_df</span><span class="p">[</span><span class="s1">'Feature'</span><span class="p">],</span> <span class="n">importance_df</span><span class="p">[</span><span class="s1">'Feature Importance'</span><span class="p">])</span>
<span class="n">plt</span><span class="o">.</span><span class="n">xlabel</span><span class="p">(</span><span class="s1">'Importance'</span><span class="p">)</span>
